window.bookSummaryJSON = "<p><b>The Romano Family rescued me from being sold like cattle, but I’m afraid I’ve exchanged one prison for another. </b></p> <p><b>Only this time, my heart isn’t safe from my captor. </b></p> <p><b>And they have no idea who I’m running from. </b></p> <p>Diece is the right-hand man to the most powerful family in the Italian Mafia. </p> <p>He’s ruthless, brutal, and has been tasked with protecting me after I stuck my neck out for his boss. </p> <p>That doesn’t mean I trust him, though. </p> <p>Against my will, Diece whisks me away under the guise of keeping me safe, but I’m not about to exchange one prison for another. </p> <p>When he finds out what I’ve been through at the hands of my previous captor, he begs me to let my guard down. </p> <p>To let him in. </p> <p>But if I do, he’ll find out the truth, and I can’t let that happen. Not just for me, but for his safety, too. </p> <p>He says he won’t let anyone hurt me. </p> <p>He has no idea who I’m running from. </p> <p><i>Contains sensitive subjects that may be offensive to some listeners. Intended for listeners 18+.</i></p>"; 
